import { Component, OnInit } from '@angular/core';


@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title: string;

  constructor() {
    this.title = 'HNI - Fullstack Project';
  }

  ngOnInit(){}

}
<div class="container">
  <div class="row">
    <div class="col-md-12">
      <div class="card grad my-5">
        <div class="card-body">
          <h2 class="card-title text-center text-white py-3">{{title}}</h2>
          <ul class="text-center list-inline py-3">
            <li class="list-inline-item"><a routerLink="/users" class="btn btn-light">List users</a></li>
            <li class="list-inline-item"><a routerLink="/adduser" class="btn btn-light">Add user</a></li>
            <li class="list-inline-item"><a routerLink="/types" class="btn btn-light">List types</a></li>
            <li class="list-inline-item"><a routerLink="/addtype" class="btn btn-light">Add type</a></li>
          </ul>
        </div>
      </div>
      <router-outlet></router-outlet>
    </div>
  </div>
</div>
